import "./App.css";
import {BrowserRouter as Router, Route, Routes} from 'react-router-dom'
import Patient from './pages/Patient.js'

function App() {


  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path = '' component={<Patient/>}/> 
        </Routes>

      </Router>
    </div>
  );
}

export default App;
